INSERT INTO evenements VALUES(80,1,'Adhésion à Gamma','Gamma',NULL,NULL,replace(replace('<p>DAES dans GAMMA2<strong> nouvelle proc&eacute;dure </strong>en application <span style="text-decoration: underline;">le 13 f&eacute;vrier 2023</span>. Les informations disponibles sur : Refonte de l&rsquo;application EMCS-GAMMA | <a href="https://www.douane.gouv.fr/fiche/refonte-de-lapplication-emcs-gamma" target="_blank" rel="noopener">"Refonte de l''applicationEMCS-GAMMA"</a></p>\r\n<p><a href="https://jeancloude.24eme.fr/index.php/s/iBR6xQwpTgR68TA" target="_blank" rel="noopener"><strong>Formulaire d''adh&eacute;sion &agrave; GAMMA</strong></a></p>\r\n<p><strong><a href="https://jeancloude.24eme.fr/index.php/s/zYdK8wsFq6zcokS" target="_blank" rel="noopener">Procuration aupres de l''administration des douanes</a></strong></p>\r\n<p>L''utilisation de la t&eacute;l&eacute;proc&eacute;dure GAMM@ est soumise aux conditions suivantes :<br />1 &ndash; Les entreprises doivent &ecirc;tre des Entrepositaires Agr&eacute;&eacute;s (EA) ou des Op&eacute;rateurs Enregistr&eacute;s (OE) disposant d''un num&eacute;ro<br />d''accises attribu&eacute; par la douane et en cours de validit&eacute; <br />2 &ndash; Les utilisateurs (personnes) de GAMM@ doivent disposer d''un ou de plusieurs comptes utilisateur Prodouane. Pour cr&eacute;er un compte utilisateur en ligne, il faut se connecter au portail des t&eacute;l&eacute;proc&eacute;dures douani&egrave;res Prodou@ne https://pro.douane.gouv.fr/ , cliquer<br />sur &laquo; <span style="text-decoration: underline;">Inscription </span>&raquo; dans la barre de menu, remplir le formulaire, le valider et attendre le message de confirmation en retour.<br />3 &ndash; Le formulaire d''adh&eacute;sion &agrave; GAMM@ permet d''associer un ou plusieurs comptes utilisateurs &agrave; un ou plusieurs droits d''acc&egrave;s &agrave;<br />la t&eacute;l&eacute;proc&eacute;dure GAMM@. Par exemple, une personne ayant un compte utilisateur donn&eacute; pourra &laquo; pr&eacute;parer &raquo; et &laquo; &eacute;mettre &raquo; un DAE si les cases correspondantes sont coch&eacute;es. Un autre utilisateur pourra disposer de tous les droits possibles si toutes les cases sont coch&eacute;es.<br />4 &ndash; Le formulaire d&ucirc;ment rempli et sign&eacute; par le repr&eacute;sentant l&eacute;gal de l''entreprise doit &ecirc;tre transmis au service de rattachement de l''op&eacute;rateur ou au bureau F/2 de la direction g&eacute;n&eacute;rale des douanes et droits indirects pour les op&eacute;rateurs du secteur des produits &eacute;nerg&eacute;tiques.</p>','\r',char(13)),'\n',char(10)),NULL,NULL,1,NULL,'2022-04-21 08:35:11','2023-02-21 07:46:36',NULL);
